import React from 'react'
import { Card } from 'antd'

const Details = ({title,bgc}) => {
  return (
    <Card title={title} headStyle={{color:'white',backgroundColor:bgc}} bordered={true} style={{boxShadow:'rgba(0, 0, 0, 0.2) 2px 2px 6px'}}>
      <p>$50</p>
    </Card>
  )
}

export default Details
